import React, {Component} from 'react';


class Gallery extends Component{
  render() {   
  return (
      <div className="container">
      <div className='display-images'>
         <img className='imginsert' src={ img1 } alt='img'/>
         <img className='imginsert' src={ img2 } alt='img'/>
         <img className='imginsert' src={ img3 } alt='img'/>
         <img className='imginsert' src={ img4 } alt='img'/>
         <img className='imginsert' src={ img5 } alt='img'/>
         <img className='imginsert' src={ img6 } alt='img'/>
         <img className='imginsert' src={ img7 } alt='img'/>
         <img className='imginsert' src={ img8 } alt='img'/>
         <img className='imginsert' src={ img9 } alt='img'/>
         <img className='imginsert' src={ img10 } alt='img'/>
         <img className='imginsert' src={ img11 } alt='img'/>
         <img className='imginsert' src={ img12 } alt='img'/>
      </div>
      </div>
    );
  }
}

export default Gallery;
